-- SQLite

CREATE TABLE ALUNNO (
  ID INTEGER PRIMARY KEY AUTOINCREMENT,
  NOME TEXT NOT NULL,
  COGNOME TEXT NOT NULL,
  CODICE_SIDI TEXT NOT NULL,
  CODICE_FISCALE TEXT NOT NULL
);

UPDATE SQLITE_SEQUENCE SET seq = 2111 WHERE name = 'ALUNNO';

CREATE TABLE ALUNNO_CLASSE (
  ID INTEGER PRIMARY KEY AUTOINCREMENT,
  ID_ALUNNO INTEGER NOT NULL,
  ID_ANNO_SCOL INTEGER NOT NULL,
  ID_CLASSE INTEGER NOT NULL
);

UPDATE SQLITE_SEQUENCE SET seq = 2048 WHERE name = 'ALUNNO_CLASSE';

CREATE TABLE ANNO_SCOL (
  ID INTEGER PRIMARY KEY AUTOINCREMENT,
  ANNO_SCOL TEXT NOT NULL,
  UNIQUE(ANNO_SCOL)
);

UPDATE SQLITE_SEQUENCE SET seq = 3 WHERE name = 'ANNO_SCOL';


CREATE TABLE CLASSE (
  ID INTEGER PRIMARY KEY AUTOINCREMENT,
  ANNO INTEGER DEFAULT NULL,
  SEZIONE TEXT DEFAULT NULL
);

UPDATE SQLITE_SEQUENCE SET seq = 64 WHERE name = 'CLASSE';















